import React from "react"
import { getOneRentService } from "../../../store/actions/RentACarActions";


const FastReservationCarInfo = (carOnDiscount) => {

    return (
        <div className="container">
            <div className="card">
                <div className="card-content">
                    <h5 className="card-title indigo-text darken-2">{carOnDiscount.carType.brand} {carOnDiscount.carType.model}, {carOnDiscount.modelYear}</h5>

                    <div>
                        <p>{carOnDiscount.branchOffice.adress} , {carOnDiscount.rentService.name}</p>
                        <p>Cena po danu : {carOnDiscount.rentPrice} , popust : {carOnDiscount.carDiscountPrecentage} </p>
                        <p>Vazi od : {carOnDiscount.dateFrom} , do: {carOnDiscount.dateTo}</p>
                    </div>
                </div>
            </div>
        </div>
    );

}

export default FastReservationCarInfo;
